description:
Informaticien / informaticienne
Le Régiment du Service Militaire Adapté (RSMA) recherche un informaticien (H/F) pour une première expérience professionnelle (sous statut militaire de volontaire technicien).

Vos missions :
En complémentarité avec les informaticiens en poste, vous effectuerez les tâches suivantes :
- Créer des utilisateurs sur un domaine local ;
- Dépanner des ordinateurs.

Les conditions du poste :
- Type de contrat : CDD de 1 an renouvelable 4 fois maximum (38h/semaine) ;
- Rémunération : Environ 940€ net / mois + prime d'activité sous conditions ;
- 45 jours de congés par an, sauf la première année 25 jours. 
- Nourri, logé, pris en charge et présenté au permis B.

Votre profil : 
- 18 à 25 ans ;
- BAC SIO ou formation similaire exigée ; 
- Bonne maitrise des outils d'administration Windows et de l'active directory;
- Connaissance de base des outils bureautique (Word Excel, .)
Les volontaires techniciens (VT) rejoignant le RSMA n'ont pas vocation initialement à rejoindre les armées.

Domaines à couvrir par les compétences :
- Bonnes pratiques de sécurisation des composants réseaux types WAF, routeurs, switchs entre autres ;
- Configuration et paramétrage des sécurités des environnements hybrides « On premise / Cloud » ;
- Assurer le hardening des postes de travail et des serveurs et machines virtuels ;
- Travailler avec les équipes IT afin de garantir des configurations sécurisées des systèmes d'exploitation, des bases de données et des applications ;
- Générer des rapports techniques sur le niveau de sécurité de l'infrastructure relative à la sécurisation d'environnement d'infrastructure IT mettant en œuvre plusieurs centaines de serveurs virtualisés, équipements réseaux et environnements cloud.
expérience relative en gestion des systèmes qui garantissent la veille et la sécurisation des environnements d'infrastructure IT.
Il est garant de la visibilité constante sur les menaces et autres activités suspects qui pourraient arriver dans l'environnement IT.
Surveiller et analyser les activités sur les systèmes pour détecter des accès non-autorisés, des vulnérabilités et autres failles ;
- Utilisation des outils de veille et d'alerting comme DarkTrace pour détecter les menaces et les vulnérabilités ;
- Traitement des alertes et remédiation des incidents détectés par les outils de veille ;
- La gestion des accès et des privilèges y compris avec les processus, les validations et l'outillage ;
- Connaissance à jour des menaces, vecteurs d'attaques, des outils et des tendances en cybersécurité.

Effectuer des scans de vulnérabilité systématiques sur l'infrastructure IT et aussi les applications web ;
- Compréhension des différents types d'attaques cyber qui pourraient cibler  tels que XSS, MiM entre autres ;
- Développer et maintenir un processus de gestion de vulnérabilité et de déploiement de correctifs ;
- Assurer le suivi et la clôture des tickets d'incidents techniques en collaboration avec les équipes IT.

Développer, documenter et maintenir à jour la base documentaire sécurité technique ;
- Ecrire les standards techniques et les guides pratiques techniques pour les équipes opérationnelles ;
- Assurer la mise en place des contrôles et paramétrages suivant la documentation.

Descriptif du poste:
Au sein du Département Opérations de la DSI, vous travaillez en binôme avec un expert DevOps au sein du pôle Cloud Azure. Dans ce cadre vos missions seront de :
- mettre en oeuvre les Chaînes CI/CD, les automatisations et le catalogue de service disponible pour les développeurs ;
- assurer la phase amont des projets afin de capitaliser, documenter, transférer et représenter l'expertise de l'OPS ;
- accompagner les différents pôles de la DSI dans le développement de leur compétences Devops ;
- définir et mettre en oeuvre les outils de déploiement continu (CI/CD) et les outils d'automatisation associés ;
- structurer et maintenir les configurations liées au monitoring, Log Management, automatisations, suivi de performance... ;
- optimiser et sécuriser les éléments d'infrastructures publiés (réseau, infrastructures, référencement,...) ;
- assurer le relais avec le Comité de validation et la gestion des changements pour les chaînes en continu, le contrôle qualité des livrables applicatifs, en mettant en place les outils ou procédures associés ;
- assurer avec les développeurs le bon fonctionnement de l'ensemble des chaînes, via une présence active dans ces équipes et le suivi et l'amélioration continus des outils et des processus ;
- accompagner nos Domaines Métiers pour intégrer les nouveaux projets dans la chaîne globale DEV OPS de la DSI.

Profil recherché:
Titulaire d'un bac +5 en Informatique de type école d'ingénieur, Master spécialisé ou équivalent, vous possédez une expérience d'au moins 5 ans dans une stratégie DEVOPS, ainsi que dans la mise en place d'infrastructures automatisées via AZURE DEVOPS.
Bonne maîtrise Devops de Design/Conception, des chaînes de déploiement d'infrastructures ou d'applications, des infrastructures AZURE, du déploiement en "infrastructure as code" et des langages et outils tels que Python,Terraform, Ansible, GIT, Azure-DEVOPS.
Expérience Kubernetes, Docker, Helm, graphana et prometheus. Expérience sur les outils de sécurité Sonarqube, Checkov et Trivy. Connaissances réseaux, systèmes et infrastructures dans des environnements OnPremise et Cloud.
Autonome, pragmatique et faisant preuve d'esprit d'analyse et de synthèse, vous appréciez le travail en équipe et en mode transversal.
Vous maîtrisez l'anglais à un bon niveau.
Participation à des astreintes opérationnelles.

Le poste à pourvoir est à temps plein basé à Paris-Orly mais induira des déplacements ponctuels sur Paris-Charles de Gaulle. Télétravail régulier.
Package de rémunération et avantages (fixe, variable, participation, intéressement, CET, plan-épargne entreprise, mutuelle, CSE).
 
 Le Groupe ADP mène une politique engagée depuis plus de 30 ans en faveur de l'égalité des chances, de l'insertion professionnelle et de l'emploi des personnes en situation de handicap. L'inclusion des différences fait la force du Groupe ADP, signataire de la Charte de la Diversité.
Convaincus que le talent n'a pas d'âge, ni genre, ni origine, ni orientation sexuelle, ni croyance, nous veillons à créer un environnement de travail inclusif pour nos collaborateurs, tenant compte des spécificités de chacun.
Alors place à l'action ! Postulez dès maintenant pour rejoindre le groupe ADP.
Pour en savoir plus sur notre politique en matière de diversité équité et inclusion, n'hésitez pas à consulter notre site Groupe ADP.
#LI-GADP

Notre client est une organisation de taille moyenne dans le secteur des Télécommunications. Il se spécialise dans la fourniture de solutions de communication par satellite et est reconnu pour son excellence en matière de technologie et de service à la clientèle. Notre client est basé au sud de Toulouse à environ 20 minutes. En tant que Développeur C#.NET Confirmé, vous aurez les responsabilités suivantes :
Développement et maintenance de logiciels OSS ;
Travail en étroite collaboration avec l'équipe technologique pour développer des solutions innovantes ;
Test et dépannage des systèmes d'exploitation en réseau ;
Rédaction de documentation technique pour les nouvelles fonctionnalités de logiciel ;
Participation à la planification et à la mise en oeuvre de stratégies d'optimisation du système ;
Respect des normes de codage et des meilleures pratiques de l'industrie ;
Collaboration avec les équipes de support pour résoudre les problèmes techniques.
  La rémunération et les avantages sur ce poste sont :
Un salaire compétitif dans la fourchette deUn environnement de travail stimulant et technologiquement avancé ;
Des opportunités de développement de carrière et de formation continue ;
Un bilan de travail/vie personnelle équilibré avec des horaires flexibles ;
Une culture d'entreprise axée sur la collaboration et l'innovation.
Nous vous encourageons à postuler si vous êtes passionné par la technologie et souhaitez faire progresser votre carrière en tant que Développeur C#.NET Confirmé. Nous avons hâte de recevoir votre candidature.
